import React, {useState, useEffect} from 'react';
import clsx from 'clsx';
import {makeStyles} from '@material-ui/core/styles';
import {apolloClient} from "../../../utils";
import {GET_AD_SELL_LEASES} from "../../../graphql/ad_sell_leases/queries"
// import uuid from "uuid";
// import dynamic from 'next/dynamic'
// const uuid=dynamic(import ('uuid'),{ssr:false})


const useStyles = makeStyles(theme => ({
    root: {},
    posts: {
        marginTop: theme.spacing(2)
    },
    post: {
        marginBottom: theme.spacing(2)
    }
}));

interface PostType {
    id: any,
    author:{
        name:string,
        avatar:string,

    },
    created_at:string,
    message:string,
    media:string,
    avatar:string,
    name:string,
    comments:{
        id:any,
        author:{
            avatar:string,
            name:string
        }
        created_at:string,
        message:string,
    }[],
    liked:boolean,
    likes:number,
}

interface TimelineProps {
    className ?: string
}

const Timeline: React.FunctionComponent<TimelineProps> = (props: TimelineProps) => {
    const { className,  ...rest } = props
    let [project, serProject] = React.useState()
    const classes = useStyles();
    const [posts, setPosts] = useState<PostType[]>([]);
    let userId = { user: "5e7b82a48928eb4d96c1a526"}
    let userFilter = JSON.stringify(userId)
    useEffect(() => {
        apolloClient.query({query: GET_AD_SELL_LEASES, variables: {
            "page": 1,
            "limit": 10,
            "filter": userFilter
        }}).then(response => { 
            serProject(response.data.adSellLeases.edges)
        })
    }, [])

    return (
        <div {...rest} className={clsx(classes.root, className)}>
            <h1>Dự án</h1>
        </div>
    );
};


export default Timeline;
